import React, { useState, useRef, useEffect } from 'react';
import {
  Shirt,
  User,
  Wand2,
  Image as ImageIcon,
  Download,
  AlertCircle,
  X,
  Loader2,
  Camera,
} from 'lucide-react';

// --- Default Garment Data (Hardcoded Base64 for Self-Contained App) ---
// Using a simple base64 encoded image (1x1 white pixel) for the API data,
// but a placeholder URL for the preview image to keep the UI aesthetic.
const DEFAULT_GARMENT_DATA = {
  // IMPORTANT: For a real application, replace this base64 string with your actual garment image data.
  // This placeholder base64 is necessary to ensure the file is self-contained and runnable.
  data: '',
  mimeType: 'image/png',
  previewUrl: 'garment-momu.png',
  label: 'Default Garment: Military Jacket',
};

// Utility function to convert File to Base64
const fileToBase64 = (file) => {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.onload = () => {
      // result is "data:image/jpeg;base64,..."
      const base64Data = reader.result.split(',')[1];
      resolve({
        data: base64Data,
        mimeType: file.type,
        previewUrl: URL.createObjectURL(file),
      });
    };
    reader.onerror = (error) => reject(error);
    reader.readAsDataURL(file);
  });
};

export default function App() {
  const defaultPrompt = 
  "Replace the person's current outfit with the military uniform garment, ensuring it is perfectly integrated into the scene. Pay meticulous attention to realistic shadows, ambient lighting, and natural fabric folds that conform to the person's body and pose. The fit should be seamless, as if the person is genuinely wearing the uniform within the original photo's environment. The final image should be a high-quality, photorealistic depiction.";

  const [personImage, setPersonImage] = useState(null);
  const [garmentImage, setGarmentImage] = useState(DEFAULT_GARMENT_DATA); // Pre-loaded garment
  const [prompt] = useState(defaultPrompt); // Fixed prompt
  const [loading, setLoading] = useState(false);
  const [resultImage, setResultImage] = useState(null);
  const [error, setError] = useState(null);

  // Note: apiKey is automatically provided by the Canvas environment
  const apiKey = import.meta.env.VITE_GEMINI_API_KEY;

  const fileInputRefPerson = useRef(null);

  // --- API Call Logic ---

  const callGeminiAPI = async (retryCount = 0) => {
    const url = `https://generativelanguage.googleapis.com/v1beta/models/gemini-2.5-flash-image-preview:generateContent?key=${apiKey}`;

    const payload = {
      contents: [
        {
          parts: [
            // 1. Prompt for instruction (Fixed)
            { text: prompt },
            // 2. Person Image (The base image to be modified)
            {
              inlineData: {
                mimeType: personImage.mimeType,
                data: personImage.data,
              },
            },
            // 3. Garment Image (The reference image for the clothing)
            {
              inlineData: {
                mimeType: garmentImage.mimeType,
                data: garmentImage.data,
              },
            },
          ],
        },
      ],
      generationConfig: {
        responseModalities: ['TEXT', 'IMAGE'],
      },
    };

    try {
      const response = await fetch(url, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(payload),
      });

      if (response.status === 429 && retryCount < 3) {
        const delay = Math.pow(2, retryCount) * 1000;
        console.log(`Rate limit hit. Retrying in ${delay}ms...`);
        await new Promise((resolve) => setTimeout(resolve, delay));
        return callGeminiAPI(retryCount + 1);
      }

      if (!response.ok) {
        const errorBody = await response.text();
        throw new Error(
          `API Error: ${response.status} ${
            response.statusText
          } - ${errorBody.substring(0, 100)}...`
        );
      }

      const result = await response.json();

      const parts = result.candidates?.[0]?.content?.parts || [];
      const imagePart = parts.find((p) => p.inlineData);

      if (!imagePart) {
        const textPart = parts.find((p) => p.text);
        if (textPart) {
          throw new Error(`Model returned: ${textPart.text}`);
        }
        throw new Error(
          'No image generated. The model may have refused the request.'
        );
      }

      setResultImage(
        `data:${imagePart.inlineData.mimeType};base64,${imagePart.inlineData.data}`
      );
    } catch (err) {
      console.error('Gemini API call failed:', err);
      setError(
        err.message || 'Failed to generate image. Check your image content.'
      );
    } finally {
      setLoading(false);
    }
  };

  const handleGenerate = () => {
    if (!personImage || !garmentImage || !prompt) {
      setError('Internal error: Missing inputs for generation.');
      return;
    }
    setLoading(true);
    setError(null);
    setResultImage(null);
    callGeminiAPI();
  };

  const handlePersonFileChange = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    if (!file.type.startsWith('image/')) {
      setError('Please upload a valid image file (JPEG, PNG).');
      // Reset input to allow re-uploading the same file if needed
      if (fileInputRefPerson.current) {
        fileInputRefPerson.current.value = '';
      }
      return;
    }

    // Reset output states
    setResultImage(null);
    setError(null);

    try {
      const newPersonImage = await fileToBase64(file);
      setPersonImage(newPersonImage);
      // *** AUTO-TRIGGER GENERATION ***
      // We must wait for the state to be set before calling the API,
      // so we use an effect to handle the final trigger.
    } catch (e) {
      setError('Failed to process image file.');
    }
  };

  // Use useEffect to trigger generation when personImage state is successfully updated
  useEffect(() => {
    if (personImage && garmentImage) {
      handleGenerate();
    }
  }, [personImage]); // eslint-disable-line react-hooks/exhaustive-deps

  const clearPersonImage = () => {
    setPersonImage(null);
    setResultImage(null);
    if (fileInputRefPerson.current) {
      fileInputRefPerson.current.value = '';
    }
  };

  // --- UI Components ---

  const ImageDisplayBox = ({
    icon: Icon,
    label,
    imageState,
    isGarment = false,
  }) => {
    const isReady = !!imageState?.data;
    const isPerson = label.includes('Photo');

    // Logic for Person upload zone
    if (isPerson) {
      return (
        <div
          className={`relative p-4 rounded-xl transition-all duration-200 shadow-xl border ${
            isReady
              ? 'bg-white border-yellow-500'
              : 'bg-slate-100 border-slate-300 hover:border-yellow-400 cursor-pointer'
          }`}
        >
          <input
            ref={fileInputRefPerson}
            type="file"
            accept="image/*" // Use image/* for better mobile support
            className="hidden" // Removed capture="environment" to default to folder picker
            onChange={handlePersonFileChange}
          />

          {isReady ? (
            <div className="relative">
              <img
                src={imageState.previewUrl}
                alt={label}
                className="w-full h-80 object-cover rounded-lg shadow-md"
              />
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  clearPersonImage();
                }}
                className="absolute -top-3 -right-3 bg-white text-slate-500 hover:text-red-500 p-1.5 rounded-full shadow-lg border border-slate-100 transition-colors z-10"
                aria-label="Remove image"
              >
                <X size={16} />
              </button>
              <div className="absolute bottom-1 left-1 bg-black/60 text-white text-xs px-2 py-0.5 rounded backdrop-blur-sm font-medium flex items-center gap-1">
                {label}
              </div>
            </div>
          ) : (
            <div
              className="py-12 flex flex-col items-center justify-center text-center"
              onClick={() => fileInputRefPerson.current.click()}
            >
              <Icon size={40} className="text-slate-400 mb-3" />
              <p className="font-bold text-slate-700 text-lg">Upload Photo</p>
              <p className="text-sm text-slate-500 mt-1 flex items-center gap-1">
                <ImageIcon size={14} /> Tap to select an image from your device
              </p>
            </div>
          )}
        </div>
      );
    }

    // Logic for Fixed Garment Display
    return (
      <div className="relative p-4 rounded-xl shadow-xl border border-blue-200 bg-white">
        <div className="relative">
          <img
            src={imageState.previewUrl}
            alt={label}
            className="w-full h-80 object-cover rounded-lg shadow-md"
          />
          <div className="absolute top-2 right-2 bg-blue-500 text-white text-xs px-3 py-1 rounded-full font-semibold shadow-md">
            FIXED GARMENT
          </div>
          <div className="absolute bottom-1 left-1 bg-black/60 text-white text-xs px-2 py-0.5 rounded backdrop-blur-sm font-medium flex items-center gap-1">
            {imageState.label}
          </div>
        </div>
        <div className="mt-3 p-2 bg-blue-50 text-blue-700 rounded-lg text-sm">
          <p className="font-semibold">Current Prompt (Hidden):</p>
          <p className="text-xs italic mt-1">{defaultPrompt}</p>
        </div>
      </div>
    );
  };

  // --- Main Render ---

  return (
    <div className="min-h-screen bg-amber-50 text-slate-900 font-sans p-4 sm:p-8">
      <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      <script src="https://cdn.tailwindcss.com"></script>

      {/* Header */}
      <header className="max-w-4xl mx-auto mb-8 text-center">
        <div className="inline-block px-3 py-1 bg-yellow-400 rounded-full font-bold text-lg -rotate-1 shadow-md">
          
        </div>
        <h1 className="text-3xl sm:text-4xl font-extrabold text-slate-800 mt-2">
          Instant Virtual Try-On
        </h1>
        <p className="text-slate-600 max-w-2xl mx-auto mt-2 text-sm sm:text-base">
          **Mobile Edition.** Upload your photo to automatically project the
          default garment using **Gemini 2.5 Flash Image**.
        </p>
      </header>

      <main className="max-w-4xl mx-auto space-y-8">
        {/* Step 1: Image Inputs (Side by Side) */}
        <section className="p-4 sm:p-6 rounded-2xl shadow-2xl border border-slate-200 bg-white/90 backdrop-blur-sm">
          <h2 className="text-xl font-bold mb-6 text-slate-700">
            1. Input Images
          </h2>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            {/* Person Image Upload (Active Input) */}
            <ImageDisplayBox
              icon={User}
              label="Your Photo"
              imageState={personImage}
            />

            {/* Garment Image (Fixed Display) */}
            <ImageDisplayBox
              icon={Shirt}
              label="Garment Reference"
              imageState={garmentImage}
              isGarment={true}
            />
          </div>
        </section>

        {/* Status and Result */}
        <section className="bg-white p-4 sm:p-6 rounded-2xl shadow-2xl border border-slate-200 min-h-[400px]">
          <h2 className="text-xl font-bold mb-4 text-slate-700">
            2. Generated Result
          </h2>

          <div className="relative flex flex-col items-center justify-center h-full min-h-[300px] bg-slate-100 rounded-xl overflow-hidden p-6">
            {loading && (
              <div className="absolute inset-0 bg-slate-50/80 backdrop-blur-sm flex flex-col items-center justify-center z-20">
                <Loader2 size={32} className="text-yellow-500 animate-spin" />
                <p className="mt-3 font-semibold text-lg text-slate-700">
                  Generating Virtual Try-On...
                </p>
                <p className="text-sm text-slate-500">
                  Processing complex image-to-image request.
                </p>
              </div>
            )}

            {error && (
              <div className="p-4 bg-red-50 text-red-700 rounded-xl border border-red-100 flex items-start gap-3 text-sm animate-in fade-in slide-in-from-top-2 w-full z-10">
                <AlertCircle size={18} className="mt-0.5 shrink-0" />
                <div>
                  <p className="font-semibold">Error:</p>
                  <p>{error}</p>
                </div>
              </div>
            )}

            {!loading && !error && !resultImage && (
              <div className="text-center text-slate-400 p-6">
                <Wand2 size={48} className="mx-auto mb-3 text-yellow-500" />
                <p className="text-lg font-medium text-slate-500">
                  Upload your photo to start the generation.
                </p>
                <p className="text-sm mt-1">
                  The result will appear automatically!
                </p>
              </div>
            )}

            {resultImage && (
              <div className="relative group p-4 z-10">
                <img
                  src={resultImage}
                  alt="Garment Projection Result"
                  className="max-h-[70vh] w-auto max-w-full rounded-lg shadow-2xl object-contain animate-in fade-in zoom-in-95 duration-500"
                />
                <a
                  href={resultImage}
                  download="gemini-garment-tryon.png"
                  className="absolute bottom-8 right-8 bg-yellow-500 hover:bg-yellow-600 text-slate-900 text-sm px-4 py-2 rounded-full font-semibold shadow-xl opacity-90 hover:opacity-100 transition-opacity flex items-center gap-1 transform hover:scale-105"
                >
                  <Download size={16} /> Download Result
                </a>
              </div>
            )}
          </div>
        </section>
      </main>

      <footer className="max-w-4xl mx-auto mt-12 pt-6 border-t border-slate-200 text-center text-slate-400 text-sm">
        <p>Powered by `gemini-2.5-flash-image-preview` (Nano Banana)</p>
      </footer>
    </div>
  );
}
